		.logo > div {
			display: block;
			line-height: 1;
			font-family: sans-serif;
			font-size: .875rem;
			text-align: left;
			letter-spacing: -.025rem;
			margin-top: .375rem;
			color: rgba(255, 255, 255, 0.9);
		}

		.logo .branch,
		.logo .desc {
			display: block;
			margin-bottom: .25rem;
		}

		.logo .branch .system {
			font-family: sans-serif;
			position: relative;
			padding-left: .5rem;
			margin-left: .25rem;
		}
		.logo .branch .system::before {
			content: '';
			position: absolute;
			top: 50%;
			left: 0;
			transform: translateY(-50%);
			display: inline-block;
			width: 1px;
			height: 14px;
			background-color: #B9C1CB;
		}

		/* .header-title */
		.header-title {
			display: block;
			text-align: center;

			padding: 1rem 0	;
			position: relative;
		}
		.header-title h1 {
			font-size: 20px;
			color: white;
			line-height: 1.4;
		}
		@media(min-width: 768px) {
			.header-title {
				margin: 1rem auto 2rem;
			}
			.header-title h1 > br {
				display: none;
			}
		}
		@media(min-width: 1024px) {
			.header-title {
				margin: 1rem auto 4rem;
			}
			.header-title h1 {
				font-size: 30px;
			}	
		}

		/* container */
		.container {
			padding: 0;
		}

		/* select-group */
		.select-group {
			display: flex;
			flex-direction: column;
			align-items: center;
			justify-content: flex-start;
			
			margin: 0 auto;
		}

		.select-group > [class*='bg0'] {
			display: inline-flex;
			align-items: center;
			justify-content: center;

			padding: 0;
			transition: all .5s ease-in-out;
		}
		.select-group > [class*='bg0'] > a {
			display: block;
			width: 280px;
			height: 280px;
			background-repeat: no-repeat;
			background-position: top center;
			background-size: 164%;
			position: relative;
